//导入 service,  下面的 request 名字可以随便换
import request from '@/utils/request'

export function getCondeImg() {
  return request({
    // url 不进行覆盖，进行拼接
    //访问的就是 localhost:8081/dev-api/captchaImage
    url: '/captchaImage',
    method: 'get',
    //这个不设置的话，用的就是 request 中，可以覆盖
    timeout: 20000
  })
}
